'use strict'

main();


// Complete the steadyGene function below.
function steadyGene(gene) {
    function index(geneChar) {
        switch (geneChar) {
            case 'A':
                return 0;
            case 'C':
                return 1;
            case 'G':
                return 2;
            case 'T':
                return 3;
        }
        return -1;
    }

    function geneCount(gene) {
        let count = [];
        for (let i = 0; i < 4; i++)
            count.push([]);

        for (let i = 0; i < gene.length; ++i)
            ++count[index(gene[i])];

        return count;
    }

    let count = geneCount(gene);
    let quarter = gene.length / 4, nOver = 0;
    for (let c of count) {
        if (c > quarter)
            ++nOver;
    }

    if (nOver == 0)
        return 0;

    let r = 0;
    while (r < gene.length && nOver != 0) {
        let ind = index(gene[r++]);
        if (--count[ind] == quarter)
            --nOver;
    }

    let l = 0, best = gene.length;
    while (r <= gene.length) {
        let ind = index(gene[l]);
        while (l < r && count[ind] != quarter) {
            count[ind]++;
            ind = index(gene[++l]);
        }
        if (r - l < best)
            best = r - l;

        if (r < gene.length)
            --count[index(gene[r])];
        ++r;
    }

    return best;
}

function main() {
    let inputs = [`200000
    `,
        `8  
    GAAATAAA`];     // expects 50022, 5
    for (let i = 0; i < inputs.length; i++) {    // 
        let input = inputs[i], lines = input.split('\n').map(s => s.trim()).filter(s => s !== ''), index = 0;

        const n = parseInt(lines[index++], 10), gene = lines[index++];
        let result = countTime(steadyGene)(gene);
        console.log(result + "\n");
    }

    function countTime(func) {
        let savedThis = this;
        return function (...args) {
            let start = new Date();
            let result = func.apply(savedThis, args);
            let end = new Date();
            console.log(`${((end - start) / 1000).toFixed(1)} seconds spent.`);
            return result;
        }
    }
}
